import {BiArchive,BiTrash} from "react-icons/bi";
import Search from './components/Search'
import AddAppointment from "./components/AddAppointment";
import appointmentList from "./data.json"
import AppointmentInfo from "./components/AppointmentInfo";

function App() {

    function pk(appointment)
    {
        return <AppointmentInfo key={appointment.id}
                                petName={appointment.petName}
                                aptDate={appointment.aptDate}
                                ownerName={appointment.ownerName}
                                aptNotes={appointment.aptNotes}
        />

    }

    return (
        <div className="App container mx-auto mt-3 font-thin">
            <h1 className="text-5xl">
                <BiArchive className="inline-block text-blue-800 align-top"/>
                Your Appointments
            </h1>

            <AddAppointment/>

            <Search/>
            <ul className="divide-y divide-gray-200">
                {
                    appointmentList.map(pk)
                }
            </ul>
        </div>
    );
}

export default App;
